package com.mycompany.app.Programming;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {

    public static void main(String[] args){

        String s = "";
        String t = "";

        System.out.println(ValidAnagram.isAnagram(s,t));
    }
    //This is my solution
    public static boolean isAnagram(String s, String t) {
        Integer sLength = s.length();
        Integer tLength = t.length();
        Map<String, Integer> sMap = new HashMap<>();  
        Map<String, Integer> tMap = new HashMap<>();  
        
        if(sLength.compareTo(tLength) != 0) return false;

        for(int i = 0; i<sLength;i++){
            String sOnI = s.charAt(i) + "";
            String tOnI = t.charAt(i) + "";
            Integer sOcurrecenAtI = sMap.get(sOnI);
            Integer tOcurrecenAtI = tMap.get(tOnI);


            if(sOcurrecenAtI == null){
                sMap.put(sOnI, 1);
            }
            if(tOcurrecenAtI == null){
                tMap.put(tOnI, 1);
            }
            if(sOcurrecenAtI != null){
                sMap.put(sOnI, ++sOcurrecenAtI);
            }
            if(tOcurrecenAtI != null){
                tMap.put(tOnI, ++tOcurrecenAtI);
            }
        }

        for(String key : sMap.keySet()){
            Integer tValue = tMap.get(key);
            Integer sValue = sMap.get(key);

            if(tValue == null){
                return false;
            }
            else if(tValue.compareTo(sValue) != 0) return false;
        }

       
      
        return true;
    }
    
}
